import unittest
from collections import Counter

# Source: https://leetcode.com/problems/find-all-anagrams-in-a-string

class Solution:
    def findAnagrams(self, s: str, p: str)->list:
        indices = []
        if len(s)<len(p):
            return indices

        p_counter = Counter(p)

        window_len = len(p)
        window = s[0:0+window_len]
        window_counter = Counter(window)
        if window_counter == p_counter:
            indices.append(0)

        for i in range(len(s)-window_len):
            # print(f"{i} | window counter before: {window_counter}")
            left_letter = s[i]                  # Leaving the window
            next_letter = s[i+window_len]       # Entering the window
            window_counter[left_letter]-=1
            if window_counter[left_letter]==0: del window_counter[left_letter]
            window_counter[next_letter]+=1
            # print(f"{i} | window counter after:  {window_counter}")
            if window_counter == p_counter:
                indices.append(i+1)

        return indices

class Test(unittest.TestCase):
    cases = [
        ("", "abc", []),
        ("cbaebabacd", "abc", [0,6]),
        ("abab", "ab", [0,1,2]),
        ("ab", "ab", [0]),
        ("aaaaa", "a", [0,1,2,3,4])
    ]
    s = Solution()

    def test0(self):
        for s, p, expected in self.cases:
            result = self.s.findAnagrams(s, p)
            print(f"RESULT: {s} | {p} | {result} | {expected}")
            self.assertEqual(result, expected)
            print("---")

